	//$wt("#navigation ul").supersubs({minWidth:14,maxWidth:27,extraWidth:0}).superfish({delay: 300,animation: {opacity:'show', height:'show'},easing: 'swing',speed: 100,autoArrows: false,dropShadows: false, disableHI: true});
